def next_smallest_palindrome(num):
    # Convert the number to a string
    num_str = str(num)
    # Find the midpoint of the string
    mid = len(num_str) // 2
    # Iterate over the digits from the midpoint to the beginning of the string
    for i in range(mid, -1, -1):
        # If the digit is not equal to 0, decrement it by 1
        if num_str[i] != '0':
            num_str = num_str[:i] + str(int(num_str[i]) - 1) + num_str[i+1:]
            break
    # If the number is now a palindrome, return it
    if num_str == num_str[::-1]:
        return int(num_str)
    # Otherwise, recursively call the function with the decremented number
    else:
        return next_smallest_palindrome(int(num_str) - 1)

