def check_min_heap(arr, i):
    # Base case: If we have reached the last element
    if i >= len(arr):
        return True

    # Check if the left child is greater than the parent
    if 2 * i + 1 < len(arr) and arr[2 * i + 1] < arr[i]:
        return False

    # Check if the right child is greater than the parent
    if 2 * i + 2 < len(arr) and arr[2 * i + 2] < arr[i]:
        return False

    # Recursively check the left and right subtrees
    return check_min_heap(arr, 2 * i + 1) and check_min_heap(arr, 2 * i + 2)

