def right_insertion(a, x):
  """Locate the right insertion point for a specified value in sorted order.

  Parameters:
    a: A sorted list.
    x: The value to insert.

  Returns:
    The index of the right insertion point.
  """

  # Check for empty list or value less than the first element.
  if not a or x < a[0]:
    return 0

  # Check for value greater than the last element.
  if x > a[-1]:
    return len(a)

  # Perform binary search to find the insertion point.
  low, high = 0, len(a) - 1
  while low <= high:
    mid = (low + high) // 2
    if a[mid] == x:
      return mid
    elif a[mid] < x:
      low = mid + 1
    else:
      high = mid - 1

  # Return the right insertion point.
  return low

