def longest_common_subsequence(X, Y, m, n):

    # Create a matrix to store the lengths of LCSs of all substrings
    lcs_matrix = [[None]*(n + 1) for _ in range(m + 1)]

    # Fill the matrix in bottom up manner
    for i in range(m + 1):
        for j in range(n + 1):
            # If both characters match
            if i == 0 or j == 0 :
                lcs_matrix[i][j] = 0
            elif X[i-1] == Y[j-1]:
                lcs_matrix[i][j] = lcs_matrix[i-1][j-1] + 1
            # If characters do not match
            else:
                lcs_matrix[i][j] = max(lcs_matrix[i-1][j], lcs_matrix[i][j-1])

    # Return length of LCS of entire string
    return lcs_matrix[m][n]

